import React from 'react'
import styled from 'styled-components'


const ButtonStyled= styled.div`

`



export default function Button({children,...props}) {
    return (
        
        <ButtonStyled {...props}>
    
        {children}
        </ButtonStyled>
    )
}

export const WhiteButton = styled(ButtonStyled)`
        background: white;  
        color: #101a3f;
        min-width: 220px;
        
        `
